$(document).ready(function(){$("#form").on("submit",function(n){n.preventDefault();$.get("/generate",$(this).serialize(),function(){var n=new Date;$("#img").attr("src","/images/output.png?"+n.getTime())})});$(".ajax-form").on("submit",function(n){$("#error").addClass("d-none");$("#loading").modal("show");n.preventDefault();$.ajax({type:"POST",url:"/",data:new FormData($(this)[0]),processData:!1,contentType:!1,success:function(n){n&&(n.key=="error"?$("#error").text(n.value).removeClass("d-none"):n.key=="success"&&(window.location.href="/Result/"+n.value));$("#loading").modal("hide")}})})});